/**
 * `ddemo-list`
 * List of ddemonstrate events
 *
 * @customElement
 * @polymer
 * @demo demo/index.html
 */
class DdemoModal extends mixinBehaviors([NeonAnimatableBehavior], PolymerElement) {

	constructor() {
		super();
	}

	async ready() {
		super.ready()
		if (typeof window.web3 !== 'undefined' && typeof window.web3.currentProvider !== 'undefined') {
			this.eth = new Eth(window.web3.currentProvider)
			//eth.setProvider(window.web3.currentProvider);
		} else {
			this.eth = new Eth(setProvider(new Web3(this.web3host).currentProvider))
			//eth.setProvider(new Web3(this.web3host).currentProvider); // set to TestRPC if not available
		}
		debugger
		
		//this.contract = this.eth.contract(abi, byteCode.object, { from: eth.accounts[0], gas: 3000000 });	

		this.eth.accounts((accountsError, accounts)=>{
			this.eth.getBalance(accounts[0]).then(function(balance){
				console.log(Eth.fromWei(balance, 'ether'));
			});
		})	


	}

	static get template() {
        return html `
        <style is-"custom-style">

            h1, h2, h3, h4, h5 {
                margin-top: 0.5em;
                padding-bottom: 0px;
                margin-bottom: 0px;
            }
            .dd-container {
                padding: 1em;
                width: 600px;
            }
            .dd-form-label {
                margin-top: 0.5em;
                margin-bottom: 0.5em;
                display: block;
            }
            .
        </style>

        <div class="ddemo-modal">
            <link rel="stylesheet" href="https://ddemonstrate.org/css/style.css"></link>
            
            <paper-dialog id="dialog">
                <div class="dd-container">
                    <h2>Register a new event</h2>

                    <p>Time to add a new ddemo!</p>

                    <paper-input label="Title"></paper-input>
                    <paper-input label="Location: what-three-words"></paper-input>
                    <a href="https://what3words.com/" target="_blank">Choose a location</a>
                    <paper-input label="Your Ethereum wallet address"></paper-input>
                    <p>
                    <div class="dd-form-label">Start time</div>
                    <datetime-picker id="fromTimePicker" class="begin" min="{{minFrom}}" auto-confirm datetime="{{minFrom}}"></datetime-picker>
                    <div class="dd-form-label">End time</div>
                    <datetime-picker id="endTimePicker" class="end" min="{{minEnd}}" datetime={{minEnd}} auto-confirm></datetime-picker>
                    <p>
                    <div class="buttons">
                        <paper-button dialog-dismiss>Cancel</paper-button>
                        <paper-button dialog-confirm autofocus on-tap="save">Register</paper-button>
                    </div>
                </div>
            </paper-dialog>

            <paper-button raised on-tap="openDlg">Add an event</paper-button>
        </div>
    `;
    }

	static get properties() {
		return {
			account: {
				type: String,
				notify: true
			},
			contract: {
				type: String,
				notify: true
            },
            minFrom: {
                type: Number,
                notify: true,
                value: new Date().getTime()
            },
            minEnd: {
                notify: true,
                type: Number,
                value: new Date().getTime()
            }
		};
    }

    openDlg() {
        console.log("open()");
        this.$.dialog.open();
    }

    save() {

        const transactionParameters = {
            from: ethereum.selectedAddress
        }

        window.ethereum.sendAsync({
            method: 'eth_sendTransaction',
            params: [transactionParameters],
            from: ethereum.selectedAddress
        }, callback)   
    }
}

